sympy.sympy.core.expr.__format__:
def __format__(self, format_spec: str):
    if self.is_number:
        mt = re.match(r'\+?\d*\.(\d+)f', format_spec)
        if mt:
            prec = int(mt.group(1))
            rounded = self.round(prec)
            if rounded.is_Integer:
                return format(int(rounded), format_spec)
            if rounded.is_Float:
                return format(rounded, format_spec)
    return super().__format__(format_spec)

sympy.sympy.core.mul.as_coeff_Mul:
def as_coeff_Mul(self, rational=False) -> tuple['Number', Expr]:
    """
    Efficiently extract the coefficient of a product.
    """
    coeff, args = self.args[0], self.args[1:]

    if coeff.is_Number:
        if not rational or coeff.is_Rational:
            if len(args) == 1:
                return coeff, args[0] # type: ignore
            else:
                return coeff, self._new_rawargs(*args) # type: ignore
        elif coeff.is_extended_negative:
            return S.NegativeOne, self._new_rawargs(*((-coeff,) + args))
    return S.One, self

